import React, { Component } from "react";
import "./index.css";

export default class Item extends Component {
  render() {
    return (
      <div className="item">
        <input type="checkbox" name="" id="" />
        <div className="content">debug</div>
        <i
          className="bi bi-trash3"
          style={{ color: "blue", cursor: "pointer" }}
        ></i>
      </div>
    );
  }
}
